import axios from 'axios';
import React, { useState } from 'react'
function GetData() {
  const [data,setData] = useState(null);
  const[setLoading] = useState(true)
  console.log(data)

 const postData= async(d)=>{
 try{
  const data= await axios.post("https://jsonplaceholder.typicode.com/users",d)
  setData(data.data)
  setLoading(false)
 }
 catch(error){
  console.log(error)
 }
 }

const handleClick=(()=>{
  postData({id:1,data:"lorem ipsum",title:"post"})
})





return (
  <>
      <button type='submit' onClick={handleClick}>Submit</button>
  </>
)
}

export default GetData
